const DataComboContext = createContext();

export const DataComboProvider = ({ children }) => {

    const [dataCombo, setDataCombo] = useState(initialData);

    const addVaccineCombo = (newVaccineCombo) => {
      const id = dataCombo.length + 1;
      setDataCombo([...dataCombo, { ...newVaccineCombo, id: id }]);
      toast.success('Thêm vaccine combo ' + newVaccineCombo.name + ' thành công !')
    };
  
    const updateVaccineCombo = (id, updatedVaccineCombo) => {
      setDataCombo(dataCombo.map((vaccineCombo) => (vaccineCombo.id === id ? updatedVaccineCombo : vaccineCombo)));
      toast.success('Sửa vaccine combo ' + updatedVaccineCombo.name + ' thành công !')
    };
  
    const deleteVaccineCombo = (id) => {
      setDataCombo(dataCombo.filter((vaccineCombo) => vaccineCombo.id !== id));
      toast.success('Xóa vaccine combo thành công !')
    };
  
    return (
      <DataComboContext.Provider value={{ dataCombo, addVaccineCombo, updateVaccineCombo, deleteVaccineCombo }}>
        {children}
      </DataComboContext.Provider>
    );
};

export const useComboData = () => useContext(DataComboContext);
